import './Hero.css';

const Hero = () => {
    const handleRedirect = (url) => {
        window.open(url, '_blank', 'noopener,noreferrer');
    };

    return (
        <div className="Hero">
            
                <div className="logo-animation" onClick={() => handleRedirect('#')}>
                <img width="" height="" autoplay loop muted >
                    <source src="/assets/dance-unscreen.gif"/>
                </img>
                </div>
                
                
        </div>
    );
}

export default Hero;
